#%%
def resourceimages(directory1,directory2):
    #%%
    img_add = b''
    img_min = b''
    img_icon = b''
    img_icon_logo = b''
    img_repeat = b''
    img_repeat_na = b''
    img_switch = b''
    img_flashbook = b''
    img_flashcard = b''
    img_print = b''
    usercommands = b''
    img_arrow = b''
    img_arrow2 = b''
    img_mouseicon = b''
    img_arrow3 = b''
    img_mouseicon2 = b'' 
    img_arrowkeys = b''
    img_wifi = b''
    img_convert = b''
    img_folder = b''
    
    images = [img_add,img_min,img_icon,img_icon_logo, img_repeat,img_repeat_na,img_switch,img_flashbook,img_flashcard,img_print,img_arrow,img_arrow2,img_mouseicon,img_arrow3,img_mouseicon2,img_arrowkeys,img_wifi,img_convert,img_folder]
    namelist = ["add.png","min.png","flashbook_icon.png",'flashbook_logo.png',"repeat.png","repeat_na.png","switch.png","flashbook.png","flashcard.png","print.png","arrow.png","arrow2.png","mouseicon.png","arrowhelp.png","mouseicon2.png","arrowkeys.png","wifi.png","convert.png","folder.png"]


    for i in range(len(images)):
        try:
            path = os.path.join(directory1, namelist[i]) # if png image doesn't yet exist then save png image
            if not os.path.exists(path):
                fh = open(path, "wb")
                fh.write(base64.b64decode(images[i]))
                fh.close()
        except:
            pass
    # user defined commands, LaTeX short cuts
    path = os.path.join(directory2, "usercommands.txt")
    if not os.path.exists(path):
        fh = open(path, "wb")
        fh.write(base64.b64decode(usercommands))
        fh.close()
        
